const e=JSON.parse('{"key":"v-ebb74202","path":"/activities/conferences/notice/third-OSEDA-workshop-24_notice.html","title":"2024年第三届OSEDA研讨会征稿通知","lang":"zh-CN","frontmatter":{"title":"2024年第三届OSEDA研讨会征稿通知","order":2},"headers":[],"git":{"createdTime":1719129241000,"updatedTime":1721963000000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":4}]},"readingTime":{"minutes":2.64,"words":791},"filePathRelative":"activities/conferences/notice/third-OSEDA-workshop-24_notice.md","localizedDate":"2024年6月23日","excerpt":"<p><strong>OSEDA研讨会及社区介绍</strong></p>\\n<p>我们相信在未来，每一位芯片的设计者都可以通过开源设计工具（EDA）设计、验证、生产使用开源指令集（RISC-V）的芯片，就像使用开源GNU工具链编译 C 语言的代码一样方便快捷。为了实现这个共同的愿景，来自RISC-V开源社区和EDA研究领域的活跃贡献者发起成立了OSEDA社区，致力于研发开源EDA技术和推广开源EDA等开源芯片开发工具在RISC-V社区的使用、推动国内外开源EDA开发者和RISC-V芯片设计者之间的交流、促进开源EDA技术社区（尤其是国内技术社区）的发展壮大。OSEDA社区的短期目标是在2025年之前吸引超过一千名、在2035年之前吸引超过一万名开发人员加入开源EDA社区，为开源项目贡献代码。</p>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{e as data};
